import {Link} from "react-router-dom";
import styled from 'styled-components';
import React, {useState} from "react";
import RightNav from "./rightnav.js"

    const StyleBurger = styled.div`
        width: 1rem
        height: 2rem;
        position: fixed;
        top: 15px;
        right: 20px;
        display: none;
        z-index: 20;

        @media (max-width: 700px) {
            display: flex;
            justify-content: space-around;
            flex-flow: column nowrap;
        }

        div {
            width: 1rem;
            height: 0.25rem;
            border-radius: 10px;
            transform-origin: 1px;
            transition: all 0.2.s linear;

            &:nth-child(1) {
                transform: ${({ open }) => open ? 'rotate(45deg)' : 'rotate(0)'};
            }

            &:nth-child(2) {
                transform: ${({ open }) => open ? 'translateX(100%)' : 'translateX(0)'};
                opacity: ${({ open }) => open ? 0 : 1};
            }

            &:nth-child(3) {
                transform: ${({ open }) => open ? 'rotate(-45deg)' : 'rotate(0)'};
            }

        }

    `;

const Hamburger = () => {
    const [open, setOpen] = useState(false);
    return(
        <>
            <StyleBurger open={open} onClick={() => setOpen(!open)}>
                    <ul>
                        <li><Link to="/summary" id="homeNav" >SUMMARY</Link></li>
                        <li><Link to="/live" id="liveNav" >LIVE</Link></li>
                        <li><Link to="/give" id="giveNav" >GIVE</Link></li>
                        <li><Link to="/grow" id="growNav" >GROW</Link></li>
                        <li><Link to="/owe" id="oweNav" >OWE</Link></li>
                        <li><Link to="/about" id="homeNav" >ABOUT</Link></li>
                    </ul>
            </StyleBurger>
            
            <RightNav open={open}/>
        </>
    )
}
export default Hamburger;
